import React from "react"
import { useFormik } from 'formik'

const Login = (props) => {

    const formik = useFormik({
        initialValues: {
            login: '',
            password: '',
            rememberMe: true
        },
        onSubmit: values =>{
            console.log(values)
        }
    }

    )
    return (
        <div>
            Login
            <form onSubmit={formik.handleSubmit}>
                <div><input id='login' name='login' type='text' placeholder='login' value={formik.values.login} onChange={formik.handleChange} /></div>
                <div><input id='password' name='password' type='password' placeholder='password' value={formik.values.password} onChange={formik.handleChange} /></div>
                <div><Field id='rememberMe' name='rememberMe' type='checkbox'/>{`${formik.values.rememberMe}`}</div>
                <button type='submit'>sign in</button>
            </form>
        </div>
    )

}

export default Login
